import React, { Component } from "react";

export default class Card extends Component {
  constructor(props) {
    super(props);
    this.state = {
      items: [],
      max: 200,
      min: 1,
      rand: 0,
    };
  }

  componentDidMount() {
    this.setState(
      Math.floor(Math.random() * (this.rand.max - this.rand.min) + 1)
    );
    console.log(rand);
    fetch(`https://jsonplaceholder.typicode.com/todos`)
      .then((response) => response.json())
      .then((data) => {
        this.setState({ items: data });
      });
  }

  render() {
    return (
      <>
        <div>Card Component</div>
        {this.state.items.map((item) => (
          <div key={item.id}>
            Title: {item.title} Completed: {item.completeted}
          </div>
        ))}
      </>
    );
  }
}
